import React from 'react';

function Search() {
    return (
      <div class="container">
        <div class="row">
            <div class="col-sm-12">
                <form class="relative">
                    <input type="text" name="search" id="search" placeholder="Search by name..." />
                    <button id="searchButton">Search <i class="fa fa-search" aria-hidden="true"></i></button>
                </form>
            </div>
        </div>
        </div>
    );
}

export default Search;
